* {
    margin: 0
}

body {
    width: 100vw;
    height: 100vh;
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
}

#card {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: space-around;
    position: relative;
    min-width: 400px;
    max-width: 30vw;
    min-height: 250px;
    max-height: 20vh;
    -webkit-box-shadow: 0 1px 3px rgba(0, 0, 0, .3);
    border-radius: 4px;
    box-shadow: 40px 40px 30px rgba(0, 0, 0, .6);
    padding: 1rem 2rem;
    background-color: white;
    animation: bounce 1s;
}

@keyframes bounce {
    0% {
        transform: scale(0);
        opacity: 0
    }

    50% {
        transform: scale(1.0);
        opacity: 1.0;
    }

    75% {
        transform: scale(1.1);
    }

    100% {
        transform: scale(1.0);
    }
}

#me {
    width: 40px;
    height: 40px;
}

.card-row {
    width: 100%;
    min-height: 20px;
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    align-items: center;
}
